import React, { useContext } from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';
import { AuthContext } from '../context/AuthContext';

const Navbar = () => {
    const { user } = useContext(AuthContext); // Assume AuthContext provides user data

    return (
        <nav className="navbar">
            <div className="navbar-logo">
                <Link to="/">SOHA</Link>
            </div>
            <ul className="navbar-menu">
                <li><Link to="/">Home</Link></li>
                <li><Link to="/about">About Us</Link></li>
                <li><Link to="/collection">The Collection</Link></li>
                <li><Link to="/accessories">Shop Accessories</Link></li>
                <li><Link to="/store">Visit Our Store</Link></li>
                <li>
                    <Link to="/account">Account</Link>
                    {user && user.isAdmin && (
                        <ul className="dropdown-menu">
                            <li><Link to="/dashboard">Dashboard</Link></li>
                        </ul>
                    )}
                </li>
            </ul>
        </nav>
    );
};

export default Navbar;
